import React from 'react'
import ClassCatalogView from './ClassCatalogView'

function CatalogView() {
    return (
        <div>
            <ClassCatalogView 
                class = {{
                    type: "Math",
                    image: "http://shorewoodadvancedlearning.weebly.com/uploads/8/4/8/3/84839576/press-rel-maalogo_orig.jpg",
                    title: "AMC 8 Preparation",
                    description: "This course acts as an introduction to the AMC (American Mathematics Competitions) AMC 8 contest. The AMC 8 provides an opportunity for middle school students to develop positive attitudes towards analytical thinking and mathematics that can assist in future careers.",
                    startDate: "10/1/19",
                    endDate: "- 11/16/19",
                    days: "Mondays, Thursdays",
                    time: "After-school hours",
                    price: "$350"
                }}
            />
            <ClassCatalogView
                class = {{
                    type: "Lego Robotics",
                    image: "https://stemminds.com/wp-content/uploads/2016/12/new-ev3.jpg",
                    title: "EV3: Advanced",
                    description: "Take your skills to the next level in EV3: Advanced, where builds incorporate deeper concepts in physical engineering. Tackle challenges with efficient programming, relying on general solutions using infrared and color sensors.",
                    startDate: "11/15/19",
                    endDate: "- 12/20/19",
                    days: "Tuesdays",
                    time: "5:00-7:00PM",
                    price: "$400"
                }}
            />
            <ClassCatalogView
                class = {{
                    type: "Programming",
                    image: "https://fiverr-res.cloudinary.com/images/t_main1,q_auto,f_auto/gigs/114798028/original/36f0ca130873344ad0c2d2428b056e608e17ff9c/do-python-coding-and-jenkins-setup.png",
                    title: "Private Python Lessons",
                    description: "Learn basic programming concepts, data structures, algorithms and object-oriented programming in Python. Use turtle and pygame libraries to practice writing good code.",
                    startDate: "Flexible scheduling",
                    time: "After-school hours",
                    price: "$50/hr"
                }}
            />
        </div>
    )
}

export default CatalogView;
